050.Pow(x, n)
问题
Implement pow(x, n), which calculates x raised to the power n (xn).
Example 1:
Input: 2.00000, 10
Output: 1024.00000
Example 2:
Input: 2.10000, 3
Output: 9.26100
Example 3:
Input: 2.00000, -2
Output: 0.25000
Explanation: 2-2 = 1/22 = 1/4 = 0.25
Note:
-100.0 &lt; x &lt; 100.0
n is a 32-bit signed integer, within the range&nbsp;[&minus;231,&nbsp;231&nbsp;&minus; 1]
思路
分治法。
时间复杂度为 O(n)
空间复杂度为 O(1)
代码
/**
 * @param {number} x
 * @param {number} n
 * @return {number}
 */
var myPow = function (x, n) {

      if (n === 0) {
        return 1
      } else if (n == 1) {
        return x
      } else if (n === -1) {
        return 1 / x
      } else {
        let mod = n % 2
        let temp = x * x
        if (mod === 0) {
          return myPow(temp, n / 2)
        } else {
          return myPow(temp, (n - 1) / 2) * x
        }
      }
    };

