        }
        let leftTree = isBalanced(root.left);
        let rightTree = isBalanced(root.right);
        let left = height(root.left);
        let right = height(root.right);
        let temp = right - left;
        if (temp = -1) {
          return leftTree && rightTree;
        } else {
          return 0;
        }
      };

